suspend fun liteClient() {
    val liteClient = LiteClient(
        ipv4 = 908566172,
        port = 51565,
        publicKey = base64("TDg+ILLlRugRB4Kpg3wXjPcoc+d+Eeb7kuVe16CS9z8="),
        logger = PrintLnLogger("TON LiteClient", Logger.Level.DEBUG)
    ).connect()
    val time = liteClient.getTime()
    println("[server time: $time] (${Instant.ofEpochSecond(time.now.toLong())})")

    transactionsRealtime(liteClient)
}

suspend fun transactionsRealtime(liteClient: LiteClient) {
    var lastSeqno = -1
    while (true) {
        val blockId = liteClient.getMasterchainInfo().last
        if (blockId.seqno == lastSeqno) {
            delay(1000)
        }
        lastSeqno = blockId.seqno
        val block = liteClient.getBlock(blockId).toBlock()
        val extraValue = block.extra.custom.value ?: continue
        extraValue.shard_hashes
            .flatMap { (key, descr) ->
                val workchain = Cell(key).beginParse().loadInt(32).toInt()
                descr.map { workchain to it }
            }.map { (workchain, descr) ->
                TonNodeBlockIdExt(
                    workchain,
                    descr.next_validator_shard,
                    descr.seq_no.toInt(),
                    descr.root_hash,
                    descr.file_hash
                )
            }.map {
                liteClient.getBlock(it)
            }.flatMap {
                it.toBlock().extra.account_blocks
            }.flatMap { (account, _) ->
                account.transactions
            }.forEach { (transaction, _) ->
                val address = AddrStd(0, transaction.account_addr)
                println("==============================================")
                println("Logical time: ${transaction.lt}")
                println("Fees: ${transaction.total_fees.coins.amount.value}")
                println("Destination: ${address.toString(true)}")
            }
    }
}

suspend fun block(liteClient: LiteClient) {
    var blockId: TonNodeBlockIdExt? = null
    while (true) {
        val currentBlockId = liteClient.getMasterchainInfo().last
        if (blockId == currentBlockId) {
            delay(1000)
            continue
        } else {
            blockId = currentBlockId
        }

        val (block, duration) = liteClient.getBlock(currentBlockId).dataBagOfCells().roots.first().parse {
            measureTimedValue {
                Block.TlbCombinator.loadTlb(this)
            }
        }
        println("${block.info.seq_no} $duration")
//        val header = liteClient.getBlockHeader(blockId, 0)
//        println("  header: $header")
    }
}